import "./App.css";

function App() {
  return (
    <div className="w-[100vw] h-[100vh] flex justify-center items-center bg-[#344151] flex-col gap-10">
      <div className="text-[#0390d4] font-medium text-2xl"> Increment && Decrement </div>
      <div className="bg-white flex justify-centere gap-12 py-3 rounded-sm text-[25px] text-[#344151]">
        <button className="border-r-2 text-center w-20 border-[#bfbfbf] text-5xl">
          -
        </button>
        <div className="border-r-2 text-center w-20 border-[#bfbfbf] text-5xl">
        0
        </div>
        <button className=" text-center w-20 border-[#bfbfbf] text-5xl">
          +
        </button>
      </div>
      <button className="text-[25px]">
         Reset
      </button>
    </div>
  );
}

export default App;
